import React, { Component } from 'react'
import { showAllProject } from '../../actions/projectAction.js'
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

class AsClient extends Component {

    componentDidMount(){
        this.props.showAllProject();
    }
     componentWillReceiveProps(nextProps){
            if(nextProps.errors){
                this.setState({
                    projects: nextProps.projects
                });
            }
     }

    render() {
        const { projects} = this.props;
 
     const Project = <h1>{projects.projectTitle}</h1>;
     
        return (
            <div>
                {Project}
            </div>
        )
    }
}
AsClient.propTypes = {
  showAllProject: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  project: PropTypes.object.isRequired
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  projects: state.projects
});
export default connect(mapStateToProps, {  showAllProject })(AsClient);
